  true,\n\t\"url\": null,\n\t\"notes\": \"Well data for the WO-2 well located in eastern
  Snake River Plain, Idaho. This data collection includes lithology reports, borehole
  logs, temperature at depth data, neutron density and gamma data, and rock strength
  parameters for the WO-2 well.nnThis collection of data has been assembled as part
  of the site characterization data used to develop the conceptual geologic model
  for the Snake River Plain site in Idaho, as part of phase 1 of the Frontier Observatory
  for Research in Geothermal Energy (FORGE) initiative. They were assembled by the
  Snake River Geothermal Consortium (SRGC), a team of collaborators that includes
  members from national laboratories, universities, industry, and federal agencies,
  lead by the Idaho National Laboratory (INL).\",\n\t\"license_title\": \"Creative
